			wait()
		until (Whole == false and CountParts(WS, Item, Whole)[1] == #Mats[Item]:GetChildren()*Amount) or (Whole == true and CountParts(WS, Item, Whole)[1] == Amount)
		local PartsTab = CountParts(WS, Item, Whole)[2]
		MoveParts(PartsTab, Tab[i], Spot)
	end
end

